import React from 'react';
import { useNavigate } from 'react-router-dom';
import homeImage from '../../assets/images/home/homeFemale.jpg';

const Home = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate("/login");
  };

  return (
    <div className="flex items-center justify-center h-screen">
      <img src={homeImage} alt="home" className="h-screen w-screen object-cover" />
      <div className="absolute inset-0 flex items-center justify-center">
        <div className="text-white text-center">
          <p className="text-4xl font-bold">Campus Cohort</p>
          <p className="text-lg">A dynamic digital space dedicated to inclusive education, skill development, and peer networking. We're here to break down barriers and provide students a peer community and connections they need to thrive in their academic and professional journeys.</p>
          <button type="button" className="bg-blue-500 text-white px-4 py-2 rounded-full mt-4" onClick={handleClick}>Get Started</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
